import React, { Component } from 'react';


class Login extends Component {
render(){
    return (
      <form id="new-post" >
        <input type="file"  />

        <input type="text" name="author" placeholder="Autor do post" />
        
        <button type="submit">Enviar</button>
      </form>
    );
  }
}

export default Login;
